    $('#opt').change(function () {
        var valor = $('#opt').val();
        $('#pai').children('div').hide();
        $('#pai').children(valor).show();
    });

    $('#opt1').change(function () {
        var valor = $('#opt1').val();
        $('#pai1').children('div').hide();
