        api.get(`totitemtrdoc/${datainicial}/${datafinal}/${combocodigosele12}/`).then(response => {
            setTabela12(response.data)


        })
    }, [datainicial, datafinal, combocodigosele12]);

    function PDF2() {
        var pdf = new jsPDF();


        pdf.autoTable({ html: '#relatorio2' })

        pdf.save('relatorio2.pdf');
    };

